import { BrowserRouter, Route, Routes } from 'react-router-dom';
import About from './components/About';
import Home from './components/sections/Home';

function App() {
  return (
    <>
    <Home/>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}>
        <Route path="About" element={<About />} />

        </Route>
      </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
